class skeleton{static lock(){for(var e=this.objects(),t=e?e.length:0,s=0;s<t;s++)e[s].classList.add("skel")}static objects(){return document.querySelectorAll(".card-image,.card-title,h1,img,p,h2,h3,h4,h5")}static release(){for(var e=this.objects(),t=e?e.length:0,s=0;s<t;s++)e[s].classList.remove("skel")}}